    false,nt"url": null,nt"notes": "This narrative report for Squaw Creek National
    Wildlife Refuge outlines Refuge accomplishments for the quarter ending July of 1938.
    The report begins by summarizing the weather conditions during this period. Wildlife-
    including migratory birds, upland game birds, predators, and rodents- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    plantings. Resource management is outlined; topics include timber removal. The public
    relations section of the report describes recreational uses and Refuge violations.",nt"license_title":
